import React from 'react';
import './style.css';

 function Container(props){
        return (
            <main class="container">
                <div
                    role="img"
                    className="click-item"
                    name={props.name }
                    onClick={() => this.props.handleClickEvent(props.name)}
                    style={{ backgroundImage: "url(" + props.src + ")" }}> </div>
            </main>
        )
}
export default Container;
